import * as React from 'react';
import{ useState } from 'react';
import AppBar from '@mui/material/AppBar';
import Box from '@mui/material/Box';
import CssBaseline from '@mui/material/CssBaseline';
import Toolbar from '@mui/material/Toolbar';
import IconButton from '@mui/material/IconButton';
import MenuIcon from '@mui/icons-material/Menu';
import AddIcon from '@mui/icons-material/Add';
import SearchIcon from '@mui/icons-material/Search';
import MoreIcon from '@mui/icons-material/MoreVert';

export default function BottomAppBar() {

    const [currPosition, setCurrPosition] = useState({ lat: 0, lng: 0 });

    navigator.geolocation.getCurrentPosition((position) => {
        setCurrPosition({ lat: position.coords.latitude, lng: position.coords.longitude });
    });

    return (
      <React.Fragment>
        <CssBaseline />
        {/* <Paper square sx={{ pb: '50px' }}>
          <Typography variant="h5" gutterBottom component="div" sx={{ p: 2, pb: 0 }}>
            Inbox
          </Typography>
          <List sx={{ mb: 2 }}>
            {messages.map(({ id, primary, secondary, person }) => (
              <React.Fragment key={id}>
                {id === 1 && (
                  <ListSubheader sx={{ bgcolor: 'background.paper' }}>
                    Today
                  </ListSubheader>
                )}
                {id === 3 && (
                  <ListSubheader sx={{ bgcolor: 'background.paper' }}>
                    Yesterday
                  </ListSubheader>
                )}
                <ListItem button>
                  <ListItemAvatar>
                    <Avatar alt="Profile Picture" src={person} />
                  </ListItemAvatar>
                  <ListItemText primary={primary} secondary={secondary} />
                </ListItem>
              </React.Fragment>
            ))}
          </List>
        </Paper> */}
        <AppBar position="fixed" color="primary" sx={{ top: 0, bottom: 'auto' }}>
          <Toolbar>
            {/* <IconButton color="inherit" aria-label="open drawer">
              <MenuIcon />
            </IconButton> */}
            <h2>Geocacher</h2>
            <h3>Current Location</h3>
                <h3>Latitude: {currPosition.lat !== 0 ? currPosition.lat : null}</h3>
                <h3>Longitude: {currPosition.lng !== 0 ? currPosition.lng : null}</h3>
            {/* <StyledFab color="secondary" aria-label="add">
              <AddIcon />
            </StyledFab> */}
            <Box sx={{ flexGrow: 1 }} />
            {/* <IconButton color="inherit">
              <SearchIcon />
            </IconButton> */}
            <IconButton color="inherit" >
              <MoreIcon />
            </IconButton>
          </Toolbar>
        </AppBar>
      </React.Fragment>
    );
  }
